import React from 'react'

const FormInput = ({ setInput }) => {

    function updateInput(e){
        setInput(e.target.value)
    }

    return(
        <div>
            <input
                className='input'
                type='text'
                onChange={updateInput}
            />
            <div>
                <i className='fas fa-plus'></i>
            </div>
        </div>
    )
};

export default FormInput;
